import React from "react";
import styled from "styled-components";

const AboutEC_Page = styled.div`
  height: 1084px;
  background-color: #f2f2f2;
`;

const AboutEcContainer = styled.div`
  max-width: 1280px;
  height: 100%;
  margin: 0 auto;
  padding-left: 40px;
  padding-right: 40px;
  box-sizing: border-box;
  display: grid;
  grid-template-columns: 131fr 135fr 319fr 314fr 215fr 86fr;
  grid-template-rows: 197fr 142fr 477fr 480fr;
  .AboutEcLeft {
    grid-column: 1 / span 1;
    grid-row: 1 / span 1;
    box-sizing: border-box;
    padding-top: 100px;
    padding-bottom: 49px;
    font-size: 32px;
    font-family: Kanit;
    font-weight: bold;
    line-height: 48px;
  }
  .AboutEcLeft span {
    display: inline-block;
    width: 131px;
    height: 48px;
  }
  .AboutEcMain {
    grid-column: 3 / span 2;
    grid-row: 2 / span 1;
    padding-bottom: 50px;
  }
  .AboutEcMain :first-child {
    display: inline-block;
    font-size: 36px;
    width: 281px;
    height: 54px;
    line-height: 54px;
    font-weight: bold;
    font-family: Kanit;
  }
  .AboutEcMain:nth-child(2) {
    font-size: 18px;
    line-height: 38px;
    font-family: NanumSquareRegular;
    color: #101010;
  }
  .AboutEcVideo {
    grid-column: 3 / span 3;
    grid-row: 3 / span 1;
    height: 477px;
    background-color: #dddddd;
  }
  .AboutEcGrowth {
    grid-column: 3 / span 1;
    grid-row: 4 / -1;
  }
  .AboutEcGrowth img {
    width: 100px;
    height: 100px;
  }
  .AboutEcSharing {
    grid-column: 4 / span 1;
    grid-row: 4/ -1;
  }
  .AboutEcCooperation {
    grid-column: 5 / span 1;
    grid-row: 4/ -1;
  }
`;

function AboutEC() {
  return (
    <AboutEC_Page>
      <AboutEcContainer>
        <div className="AboutEcLeft">
          <span>AboutEC</span>
        </div>
        <div className="AboutEcMain">
          <span>Endless Creation</span>
          <span>
            은 사람과 컴퓨터를 사랑하는 동아리로,
            <br /> 개발하는 재미와 성장하는 즐거움을 알아갈 수 있는 다양한
            활동을 준비하고 있습니다.
          </span>
        </div>
        <div className="AboutEcVideo"></div>

        <div className="AboutEcGrowth">
          <img src="../../image/Growth.png" />
        </div>
        <div className="AboutEcSharing">2</div>
        <div className="AboutEcCooperation">3</div>
        <img src="../../inhyeok.png"></img>
      </AboutEcContainer>
    </AboutEC_Page>
  );
}

export default AboutEC;
